import React, { Component } from 'react';
import '../../statics/style/banner.css'

class Banner extends Component{
    constructor(props) {
        super(props);

    }

    render(){
        return(
            <div>
                <div>
                    {this.props.bannerList.map((item)=>{
                        return (
                            <div
                                key={item}
                                className="banner-div"
                            >
                                <img src={item} />
                            </div>
                        )
                    })
                    }
                </div>
                <ol>
                    {this.props.bannerList.map((item)=>{
                        return (
                            <li key={item}>1</li>
                        )
                    })}
                </ol>
            </div>
        )
    }
}

export default Banner;
